import React, { Component } from "react";

class Like extends Component {
  state = {};
  render() {
    if (this.props.liked) return <i className="fa fa-heart"></i>;
    return (
      <i
        className="fa fa-heart-o"
        onClick={() => this.props.onClick(this.props.liked)}
      ></i>
    );
  }
}

export default Like;
